import React, { Fragment } from "react";
import { Container } from "../../Componentes/Header/styles";
import { Header, Wrapper } from "./styles";

const Home = () => {
    return(
        <Container>
            <Header>
                <h2>
                    Find the property.
                </h2>
            </Header>
            <Wrapper>
                <h2>
                    Cards
                </h2>
            </Wrapper>
        </Container>
    )
}

export default Home;
